import './footer.css';
import hdblogosmall from './hdb-logo-small.png';
import iraslogosmall from './iras-logo-small.png';
import maslogosmall from './mas-logo-small.png';

function Footerbanner(){
  return(
    <>  
      <p className="footerbanner">
      <p><br/></p>
        <table className="footertable">
          <tr className="footerrow1">
            <th className="footercolumn1">/&nbspSponsored by: </th>
          </tr>
        </table>
          <p className="footerrow2">
            <p className="sponsorcontainer" colSpan="4">
              <a href="https://www.hdb.gov.sg/cs/infoweb/homepage" target="_blank" rel="noopener noreferrer" className="sponsorelement"><img src={hdblogosmall} alt="hdblogosmall" className="logosponsor"/></a>
              <a href="https://www.iras.gov.sg/" target="_blank" rel="noopener noreferrer" className="sponsorelement"><img src={iraslogosmall} alt="hdblogosmall" className="logosponsor"/></a>
              <a href="https://www.mas.gov.sg/" target="_blank" rel="noopener noreferrer" className="sponsorelement"><img src={maslogosmall} alt="maslogosmall" className="logosponsor"/></a>
              <a href="https://www.youtube.com"target="_blank" rel="noopener noreferrer" className="sponsorelement">sponsor4</a>
            </p>
          </p>
        <p className="privatelimited">@2024 Big Guy Pte. Ltd.</p>
      </p>
    </>
  );
}

export default Footerbanner;
